package org.jn.core.java.student.shoaeeb.datatype;

public class SwapOfTwoNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=5;
		int b=6;
		int temp;
		System.out.println("Value of a: " +a + " value of b: "+b);
		temp=a;
		a=b;
		b=temp;
		System.out.println("Value of a: " +a + " value of b: "+b);
		
	}

}
